(8, 'supercomputación en todo el mundo. Más recientemente, se ha trasladado al mercado de la informática móvil, donde produce procesadores móviles Tegra para teléfonos inteligentes y tabletas, así como sistemas de navegación y entretenimiento para vehículos. Además de AMD, sus competidores incluyen Intel, Qualcomm y empresas aceleradoras de IA como Graphcore. Las GPU de NVIDIA se utilizan para computación en la nube y supercomputadoras. NVIDIA amplió su presencia en la industria de los videojuegos con sus consolas de juegos portátiles Shield Portable, Shield Tablet y Shield TV y su servicio de videojuegos en la nube GeForce Now. NVIDIA anunció planes el 13 de septiembre de 2020 para adquirir Arm de SoftBank, en espera de la aprobación regulatoria, por un valor de US$40 mil millones en acciones', '[-0.004491617903113365, -0.03812247887253761, 0.03650590777397156, 0.024985264986753464, 0.043708864599466324, -0.009341337718069553, -0.010538420639932156, 0.05046163871884346, 0.003189662704244256, -0.020196933299303055, -0.02416674606502056, 0.014109205454587936, 0.0036756577901542187, -0.06421273946762085, -0.026356281712651253, 0.009934763424098492, -0.04866090044379234, -0.03269979730248451, 0.022038599476218224, -0.03114461340010166, 0.003363597672432661, 0.020033229142427444, 0.02385980263352394, -0.05512719228863716, 0.015531380660831928, 0.003189662704244256, -0.02584470808506012, 0.004553006961941719, -0.008875804953277111, -0.048988305032253265, 0.012093604542315006, -0.022877579554915428, -0.0009758270462043583, -0.011264855042099953, -0.011254623532295227, -0.00295945443212986, 0.0034863753244280815, 0.005407335236668587, -0.012206151150166988, 0.03529859334230423, 0.03650590777397156, 0.008128907531499863, -0.03016239032149315, 0.04010738432407379, -0.037979237735271454, -0.00465787947177887, -0.05602756142616272, -0.06417182087898254, -0.02846396528184414, 0.05001145601272583, -0.036301277577877045, -0.03822479397058487, -0.002736919792369008, 0.083775326609