(10, 'La empresa fue fundada el 5 de abril de 1993 por Jensen Huang (CEO a partir de 2022),[16] un ingeniero eléctrico taiwanés que anteriormente fue director de CoreWare en LSI Logic y diseñador de microprocesadores en AMD; Chris Malachowsky, ingeniero que trabajó en Sun Microsystems; y Curtis Priem, quien anteriormente fue ingeniero senior y diseñador de chips gráficos en IBM y Sun Microsystems. En 1993, los tres cofundadores creían que la dirección correcta para la próxima ola de computación era la computación acelerada o basada en gráficos porque podía resolver problemas que la computación de propósito general no podía. También observaron que los videojuegos eran simultáneamente uno de los problemas más desafiantes desde el punto de vista computacional y tendrían un volumen de ventas', '[0.024294570088386536, -0.01228690892457962, -0.0031211774330586195, 0.004962468519806862, 0.0899643748998642, -0.029530467465519905, 0.011687689460814, 0.06841573864221573, -0.05012500286102295, -0.04118907079100609, 0.07660701125860214, 0.03195061534643173, 0.016952676698565483, -0.05352251976728439, -0.06962581723928452, 0.0238175205886364, -0.02666817605495453, -0.07125476002693176, -0.01869797520339489, -0.070556640625, 0.00650414964184165, 0.010314720682799816, 0.003862929530441761, 0.005151542369276285, 0.020036038011312485, -0.005352251697331667, 0.003199715865775943, 0.035441216081380844, -0.010745227336883545, -0.08102843910455704, 0.01395076047629118, -0.01118736993521452, 0.022572539746761322, 0.0230728592723608, -0.024829795584082603, -0.00971550028771162, -0.008703227154910564, -0.0010588150471448898, -0.02251436375081539, 0.006742673926055431, 0.002411422086879611, -0.00347605487331748, 0.0009061013115569949, 0.05249860882759094, -0.019826602190732956, -0.042166437953710556, -0.06352890282869339, 0.015614612959325314, -0.03136885166168213, 0.05603574961423874, -0.029227949678897858, -0.027971332892775536, 0.026063140481710434, 0.09196565300226212, -0.01362497173249