(11, 'increíblemente alto. Los videojuegos se convirtieron en el volante de inercia de la empresa para llegar a grandes mercados y financiar una enorme investigación y desarrollo para resolver problemas informáticos masivos. Con 40,000 dólares en el banco, nació la compañía.[19] Posteriormente, la compañía recibió 20 millones de dólares en fondos de capital de riesgo de Sequoia Capital y otros. NVIDIA inicialmente no tenía nombre y los cofundadores nombraron todos sus archivos NV, como \"Next Version\". La necesidad de incorporar la empresa llevó a los cofundadores a revisar todas las palabras con esas dos letras, llevándolos a \"iNVIDIA\", la palabra latina para \"eNVIDIA\".[19] NVIDIA se hizo pública el 22 de enero de 1999. Lanzamientos y adquisiciones El lanzamiento de RIVA TNT en 1998 solidificó', '[0.026163889095187187, -0.038553472608327866, -0.005277720279991627, -0.021038001403212547, 0.04275621473789215, -0.020965121686458588, -0.00778600387275219, 0.060733262449502945, -0.030512390658259392, -0.012498904950916767, 0.04584146663546562, 0.0477120503783226, -0.0008639306179247797, -0.09586138278245926, -0.020637162029743195, 0.016604473814368248, -0.04664314538240433, -0.058741211891174316, -0.03073102980852127, -0.04227035120129585, -0.005053007509559393, 0.04999561980366707, -0.00011539319530129433, -0.022774972021579742, 0.021596748381853104, -0.031314071267843246, -0.011442146264016628, -0.012310631573200226, 0.013835037127137184, -0.05689492076635361, 0.018717991188168526, -0.009935961104929447, 0.003367659403011203, 0.033330414444208145, -0.01828071102499962, -0.0224470142275095, 0.009923814795911312, -0.031945694237947464, -0.0031520563643425703, 0.024924930185079575, 0.03454507887363434, -0.0036956188268959522, -0.005150180775672197, 0.02582378312945366, -0.03714446350932121, -0.04384941607713699, -0.05363961681723595, -0.025022104382514954, -0.02203402668237686, 0.06996471434831619, -0.05966435745358467, -0.0411042720079422, 0.0018523645121604204, 0.