(12, 'la reputación de NVIDIA en el desarrollo de adaptadores de gráficos competentes. A finales de 1999, NVIDIA lanzó la GeForce 256 (NV10), sobre todo introduciendo la transformación e iluminación (T&L) integradas en el hardware 3D de nivel de consumidor. Funcionando a 120 MHz y con canalizaciones de cuatro píxeles, implementó aceleración de video avanzada, compensación de movimiento y combinación alfa de subimagen de hardware. La GeForce superó a los productos existentes por un amplio margen. Debido al éxito de sus productos, NVIDIA ganó el contrato para desarrollar el hardware de gráficos para la consola de juegos Xbox de Microsoft, lo que le valió a NVIDIA un anticipo de $200 millones de dólares. Sin embargo, el proyecto alejó a muchos de sus mejores ingenieros de otros proyectos. A corto', '[0.017430586740374565, -0.0050177364610135555, 0.04052058979868889, -0.004975659307092428, 0.013727770186960697, -0.01056670118123293, 0.015000613406300545, 0.03850087150931358, 0.00641681207343936, 0.0010736326221376657, 0.04771583527326584, 0.03580791503190994, -0.03725958615541458, -0.047631680965423584, -0.019019009545445442, 0.016189301386475563, -0.061138544231653214, -0.037512052804231644, -0.02819189615547657, -0.013159723952412605, 0.008336596190929413, 0.04914646968245506, 0.005627859849482775, 0.0012215611059218645, 0.009483207017183304, -0.0450228787958622, 0.013117646798491478, -0.03391442820429802, 0.000635435339063406, -0.06833378970623016, -0.02326883375644684, -0.013717250898480415, 0.05099787563085556, 0.01945030316710472, 0.03206302225589752, -0.018408887088298798, 0.019260955974459648, -0.013580499216914177, 0.005533185321837664, 0.012244539335370064, 0.016315532848238945, 0.007647577673196793, -0.04031020402908325, 0.05596301704645157, 0.005854025948792696, -0.025015046820044518, -0.06500966846942902, -0.04325562343001366, -0.015579177998006344, 0.048220764845609665, -0.04298212006688118, -0.015274116769433022, 0.01532671321183443, 0.07796952873468399, 