(13, 'plazo, esto no importó, y la GeForce2 GTS se envió en el verano de 2000. En diciembre de 2000, NVIDIA llegó a un acuerdo para adquirir los activos intelectuales de su otrora rival 3dfx, un pionero en tecnología de gráficos 3D de consumo líder en el mercado. desde mediados de la década de 1990 hasta 2000. El proceso de adquisición finalizó en abril de 2002. En julio de 2002, NVIDIA adquirió Exluna por una suma no revelada. Exluna creó herramientas de representación de software y el personal se fusionó con el proyecto Cg. En agosto de 2003, NVIDIA adquirió MediaQ por aproximadamente 70 millones de dólares. El 22 de abril de 2004, NVIDIA adquirió iReady, también proveedor de soluciones de descarga de TCP/IP e iSCSI de alto rendimiento.[28] En diciembre de 2004, se anunció que NVIDIA ayudaría', '[-0.01292648259550333, -0.02377789281308651, 0.02415628917515278, -0.023558178916573524, 0.05566077679395676, -0.01812637224793434, -0.02712242305278778, 0.06552347540855408, -0.031028442084789276, 0.0017821213696151972, 0.07860863953828812, 0.021153535693883896, -0.028587179258465767, -0.05282891169190407, -0.006469344720244408, 0.02137324959039688, -0.04264884814620018, -0.07846216857433319, -0.01678367704153061, -0.024412620812654495, 0.043649766594171524, 0.03356735408306122, 0.02140986919403076, -0.028806893154978752, 0.005880390293896198, -0.010540149174630642, 0.018761100247502327, -0.007665562909096479, 0.005807152483612299, -0.051461804658174515, 0.008117196150124073, -0.013024133630096912, 0.00939885899424553, 0.020836172625422478, -0.00986880250275135, -0.026341218501329422, -0.015074793249368668, 0.02577972784638405, -0.03368941694498062, -0.0010466910898685455, 0.010857513174414635, 0.000653419061563909, -0.02011599950492382, 0.05619785562157631, -0.0067867087200284, -0.03903578221797943, -0.027293311432003975, -0.015514221042394638, -0.016185568645596504, 0.05038765072822571, -0.013390323147177696, -0.020347919315099716, -0.004391220398247242, 0.0892525464296