(14, 'a Sony con el diseño del procesador de gráficos (RSX) en la consola de juegos PlayStation 3. El 14 de diciembre de 2005, NVIDIA adquirió ULI Electronics, que en ese momento suministraba piezas de puente sur de terceros para chipsets a ATI, el competidor de NVIDIA.[29] En marzo de 2006, NVIDIA adquirió Hybrid Graphics.[30] En diciembre de 2006, NVIDIA, junto con su principal rival en la industria gráfica AMD (que había adquirido ATI), recibió citaciones del Departamento de Justicia de Estados Unidos con respecto a posibles violaciones antimonopolio en la industria de tarjetas gráficas. Forbes nombró a NVIDIA su Compañía del Año para 2007, citando los logros que logró durante dicho período, así como durante los cinco años anteriores. El 5 de enero de 2007, NVIDIA anunció que había completado', '[0.0019722285214811563, -0.06859558075666428, 0.011137289926409721, -0.022569887340068817, 0.04066798463463783, -0.010546675883233547, -0.0548849031329155, 0.037250861525535583, -0.006227812264114618, -0.039465662091970444, 0.039275821298360825, 0.0040051001124084, -0.02305503375828266, -0.039486754685640335, -0.02526983618736267, -0.007482866756618023, -0.021451938897371292, -0.02931975945830345, 0.00925470795482397, -0.04408510774374008, 0.0456882007420063, 0.04948500543832779, 0.0548849031329155, -0.015197760425508022, 0.03874848783016205, -0.015957120805978775, 0.00019775018154177815, -0.027315892279148102, 0.007034632842987776, -0.01382669247686863, 0.016241881996393204, -0.020217977464199066, 0.03071192093193531, -0.0003994553699158132, 0.00041890080319717526, -0.012866945005953312, -0.018762536346912384, -0.02828618511557579, -0.0013400870375335217, 0.032061897218227386, 0.0675830990076065, 0.02647215686738491, -0.03995081037282944, 0.06041136011481285, -0.02545967698097229, -0.006001058965921402, -0.043135907500982285, -0.052058394998311996, 0.0014264379860833287, 0.06433472782373428, -0.036048538982868195, -0.0369766466319561, 0.030986133962869644, 0.063617549836