(15, 'la adquisición de PortalPlayer, Inc. En febrero de 2008, NVIDIA adquirió Ageia, desarrollador del motor de física PhysX y la unidad de procesamiento de física. NVIDIA anunció que planeaba integrar la tecnología PhysX en sus futuros productos de GPU.[34] [35] En julio de 2008, NVIDIA realizó una amortización de aproximadamente $ 200 millones en sus ingresos del primer trimestre, luego de informar que ciertos chipsets móviles y GPU producidos por la compañía tenían \"tasas de falla anormales\" debido a defectos de fabricación. NVIDIA, sin embargo, no reveló los productos afectados. En septiembre de 2008, NVIDIA se convirtió en objeto de una demanda colectiva por los defectos, alegando que las GPU defectuosas se habían incorporado a ciertos modelos de portátiles fabricados por Apple Inc., Dell', '[-0.006679375655949116, -0.014018585905432701, 0.0020518533419817686, 0.028037171810865402, 0.021207306534051895, -0.005472573451697826, -0.040099404752254486, 0.024286534637212753, -0.009845422580838203, -0.01508358120918274, 0.02488848753273487, 0.006303154397755861, -0.05977867543697357, -0.027226848527789116, -0.011460280045866966, 0.03306117281317711, -0.03257497772574425, -0.049638062715530396, -0.001619198708795011, -0.02752782590687275, 0.014817331917583942, 0.04056244716048241, 0.031880415976047516, -0.04151168093085289, 0.013335599564015865, -0.028477059677243233, -0.00294031435623765, -0.06612234562635422, 0.007420242298394442, -0.018093351274728775, 0.027805650606751442, -0.007790675386786461, 0.0475543774664402, 0.022735344246029854, -0.010169551707804203, -0.03090802952647209, -0.0382472388446331, 0.008462086319923401, -0.02794456295669079, 0.004132646601647139, 0.03287595510482788, 0.007674915250390768, -0.07482752948999405, 0.06663168966770172, -0.03664974495768547, 0.001889788662083447, -0.025884026661515236, -0.05371282994747162, -0.01624118536710739, 0.06065845489501953, -0.024055013433098793, -0.019216228276491165, 0.0188689474016428, 0.05000849813222