(16, 'y HP. En septiembre de 2010, NVIDIA llegó a un acuerdo en el que reembolsaría a los propietarios de las computadoras portátiles afectadas las reparaciones o, en algunos casos, el reemplazo.[36] [37] El 10 de enero de 2011, NVIDIA firmó un acuerdo de licencia cruzada de $ 1.5 mil millones por seis años con Intel, poniendo fin a todos los litigios entre las dos compañías. En noviembre de 2011, después de presentarlo inicialmente en el Mobile World Congress, NVIDIA lanzó su sistema Tegra 3 ARM en un chip para dispositivos móviles. NVIDIA afirmó que el chip presentaba la primera CPU móvil de cuatro núcleos. En mayo de 2011, se anunció que NVIDIA había acordado adquirir Icera, una empresa de fabricación de chips de banda base en el Reino Unido, por 367 millones de dólares. En enero de 2013,', '[0.024275129660964012, -0.01178180892020464, 0.04419747740030289, 0.007350551430135965, -0.0035444828681647778, -0.021952250972390175, -0.02952776663005352, 0.02042459324002266, -0.011530687101185322, -0.022077811881899834, 0.0018873390508815646, 0.009495551697909832, -0.0506429448723793, -0.015015005134046078, -0.02126166597008705, -0.005582233425229788, -0.030092790722846985, -0.041225869208574295, 0.012597955763339996, -0.00317303161136806, -0.00586997764185071, 0.04808986932039261, 0.02347991056740284, -0.054577190428972244, 0.03676845133304596, -0.011300492100417614, -0.017902908846735954, -0.043444111943244934, 0.02557259425520897, -0.040263231843709946, -0.0024902934674173594, -0.00738194165751338, 0.004773934371769428, 0.0073296246118843555, -0.0009462853777222335, -0.035178013145923615, -0.014565078541636467, 0.025028496980667114, -0.010343088768422604, 0.03166230395436287, 0.022956740111112595, 0.021847616881132126, -0.021136105060577393, 0.03775201365351677, -0.046415723860263824, -0.021219812333583832, -0.03670567274093628, -0.012744443491101265, -0.030071863904595375, 0.047378357499837875, -0.02454717829823494, -0.015035931952297688, 0.02454717829823494, 0.079731