(17, 'NVIDIA presentó Tegra 4, así como NVIDIA Shield, una consola de juegos portátil basada en Android que funciona con el nuevo sistema en chip.El 29 de julio de 2013, NVIDIA anunció que adquirió PGI de STMicroelectronics. En 2014, NVIDIA transfirió los juegos de Valve Portal y Half Life 2 a su tableta NVIDIA Shield como Lightspeed Studio. Desde 2014, NVIDIA ha diversificado su negocio centrándose en tres mercados: juegos, electrónica automotriz y dispositivos móviles. El 6 de mayo de 2016, NVIDIA presentó las primeras GPU de la serie GeForce 10, las GTX 1080 y 1070, basadas en la nueva microarquitectura Pascal de la empresa. NVIDIA afirmó que ambos modelos superaron a su modelo Titan X basado en Maxwell; los modelos incorporan memoria GDDR5X y GDDR5 respectivamente, y utilizan un proceso de', '[-0.009239752776920795, -0.012672525830566883, 0.013721007853746414, 0.002848041709512472, 0.005902755539864302, 0.005504533648490906, -0.03040599636733532, 0.02314727008342743, -0.0010119369253516197, -0.043753985315561295, -0.006830259691923857, 0.03903581574559212, -0.022864986211061478, -0.04722204431891441, -0.029176045209169388, -0.033269159495830536, -0.047705959528684616, -0.056416429579257965, -0.017310045659542084, 0.01905415579676628, 0.025385377928614616, 0.032603777945041656, 0.04601225629448891, -0.0358903668820858, 0.009204467758536339, 0.014124270528554916, -0.02875261940062046, -0.02677663415670395, -0.009511955082416534, -0.0066084652207791805, 0.007490601856261492, -0.002636329038068652, 0.019699376076459885, 0.00010270593338645995, 0.008352575823664665, -0.029760776087641716, 0.003964575007557869, 0.024115100502967834, -0.011180453933775425, 0.032361820340156555, 0.026171740144491196, 0.04177800193428993, -0.049117378890514374, 0.05206119641661644, -0.03336997702717781, -0.0001068015699274838, -0.029276860877871513, -0.03960038349032402, -0.04657682403922081, 0.049399662762880325, -0.028248541057109833, -0.030123712494969368, 0.002653971780091524, 0.0795