(19, 'inteligencia artificial de la serie Drive PX de NVIDIA para sus vehículos autónomos.[51] En julio de 2017, NVIDIA y el gigante de búsqueda chino Baidu anunciaron una asociación de inteligencia artificial de gran alcance que incluye computación en la nube, conducción autónoma, dispositivos de consumo y el marco de trabajo de inteligencia artificial de código abierto de Baidu, PaddlePaddle. Baidu reveló que Drive PX 2 AI de NVIDIA será la base de su plataforma de vehículos autónomos. NVIDIA lanzó oficialmente Titan V el 7 de diciembre de 2017. NVIDIA lanzó oficialmente la NVIDIA Quadro GV100 el 27 de marzo de 2018. NVIDIA lanzó oficialmente las GPU RTX 2080 el 27 de septiembre de 2018. En 2018, Google anunció que las tarjetas gráficas Tesla P4 de NVIDIA se integrarían en la inteligencia', '[0.013293315656483173, -0.03745551034808159, 0.03801025450229645, -0.029360352084040642, 0.02656608447432518, -0.03622274473309517, -0.030654756352305412, 0.05880288779735565, -0.014710995368659496, -0.021511748433113098, -0.001842726836912334, 0.017926456406712532, -0.03244226425886154, -0.10264822840690613, -0.018922941759228706, 0.007072988897562027, -0.05592643842101097, -0.05337872356176376, 0.013293315656483173, 0.006497698836028576, -0.0022087038960307837, 0.02903161570429802, 0.028456324711441994, -0.02656608447432518, 0.012625567615032196, -0.007992425933480263, -0.01574857160449028, 0.008172204717993736, -0.022785605862736702, -0.03079857863485813, -0.016334135085344315, -0.010642871260643005, 0.018871577456593513, -0.008747494779527187, 0.02744956687092781, -0.03459960222244263, 0.00208927970379591, 0.01781345345079899, -0.028024856001138687, 0.04211946949362755, 0.02401837147772312, 0.021963762119412422, -0.014484988525509834, 0.02354581095278263, -0.028291955590248108, -0.03983885422348976, -0.008860497735440731, -0.045283567160367966, -0.005449848249554634, 0.0452013835310936, -0.04162636399269104, -0.014628810808062553, -0.012327649630606174, 0.07848603278398514