(20, 'artificial del servicio Google Cloud. En mayo de 2018, en el foro de usuarios de NVIDIA, se inició un hilo[57] solicitando a la empresa que actualizara a los usuarios cuando lanzarían controladores web para sus tarjetas instaladas en máquinas Mac Pro heredadas hasta mediados de 2012 5,1 con macOS Mojave sistema operativo 10.14. Se requieren controladores web para habilitar la aceleración de gráficos y las capacidades de múltiples monitores de pantalla de la GPU. En su sitio web de información de actualización de Mojave, Apple declaró que macOS Mojave se ejecutaría en máquinas heredadas con tarjetas gráficas \'compatibles con Metal\'[58] y enumeraban GPU compatibles con Metal, incluidas algunas fabricadas por NVIDIA. Sin embargo, esta lista no incluía tarjetas compatibles con Metal que', '[-0.0037536330055445433, 0.049509674310684204, 0.018672462552785873, -0.02190505340695381, -0.015099599957466125, -0.013281268067657948, -0.030050329864025116, 0.049424607306718826, -0.03056073933839798, 0.004256066866219044, 0.0037616081535816193, 0.04276802018284798, -0.013791676610708237, -0.004545830190181732, -0.03217703476548195, -0.007778420578688383, -0.04768070951104164, -0.027285614982247353, 0.03475034609436989, 0.0021306918933987617, 0.008538717404007912, 0.060653604567050934, 0.010415533557534218, -0.0026198336854577065, 0.025010041892528534, 0.03881235048174858, -0.028136296197772026, -0.007826271466910839, 0.015620642341673374, -0.0103145157918334, -0.009314964525401592, -0.0070500243455171585, 0.005896287504583597, 0.03370826318860054, -0.021203240379691124, -0.05912237614393234, -3.397742329980247e-05, -0.015365437604486942, -0.018076986074447632, 0.01257945504039526, 0.011399134993553162, 0.0219475869089365, -0.010883408598601818, 0.04270422086119652, -0.02866797335445881, -0.008395165205001831, -0.04266168549656868, -0.07209527492523193, -0.022713201120495796, 0.03874855116009712, -0.04878659546375275, -0.017704812809824944, -0.006901155225932598, 0.07856045