(22, 'administración de Apple \"no quiere compatibilidad con NVIDIA en macOS\".[63] El mes siguiente, Apple Insider continuó con otra afirmación de que el soporte de NVIDIA se abandonó debido a \"problemas relacionales en el pasado\",[64] y que Apple estaba desarrollando su propia tecnología de GPU.[65] Sin los controladores web de NVIDIA aprobados por Apple, los usuarios de Apple deben reemplazar sus tarjetas NVIDIA con una marca compatible de la competencia, como AMD Radeon de la lista recomendada por Apple. El 11 de marzo de 2019, NVIDIA anunció un acuerdo para comprar Mellanox Technologies por $6900 millones[67] para expandir sustancialmente su presencia en el mercado de la computación de alto rendimiento. En mayo de 2019, NVIDIA anunció nuevas computadoras portátiles RTX Studio. Los creadores', '[-0.007914673537015915, -0.02387099340558052, 0.017712784931063652, -0.002960066543892026, -0.004192766267806292, -0.01769162341952324, -0.03155288100242615, 0.041837725788354874, -0.006004782393574715, -0.003401828231289983, 0.002161192474886775, 0.05341346189379692, -0.050196804106235504, -0.022537773475050926, -0.037139710038900375, 0.003938819747418165, -0.06716891378164291, -0.03796503692865372, 0.03612392395734787, 0.006539128255099058, 0.0009172502905130386, 0.07093578577041626, 0.00685656163841486, -0.03419816121459007, 0.03942523151636124, 0.008417275734245777, -0.03343632072210312, -0.03134125843644142, 0.006808946840465069, -0.03936174511909485, -0.0019998305942863226, -0.012305835261940956, 0.017395351082086563, 0.03694925084710121, -0.010930290445685387, -0.02670673094689846, 0.02501375414431095, -0.016771065071225166, -0.00380391045473516, 0.014707748778164387, 0.027553221210837364, 0.050620049238204956, -0.02581791765987873, 0.06276717036962509, -0.02086595632135868, 0.003880623495206237, -0.0500275082886219, -0.07131671160459518, 0.003711325814947486, 0.028611332178115845, -0.0693274587392807, -0.00647035101428628, -0.017194310203194618, 0.06255554407835