(23, 'dicen que la nueva computadora portátil será siete veces más rápida que una MacBook Pro de gama alta con un Core i9 y gráficos Radeon Pro Vega 20 de AMD en aplicaciones como Maya y RedCine-X Pro.[68] En agosto de 2019, NVIDIA anunció Minecraft RTX, un parche oficial desarrollado por NVIDIA para el juego Minecraft que agrega el trazado de rayos DXR en tiempo real exclusivamente a la versión de Windows 10 del juego. Todo el juego es, en palabras de NVIDIA, \"reacondicionado\" con trazado de ruta, lo que afecta drásticamente la forma en que funcionan la luz, los reflejos y las sombras dentro del motor. En mayo de 2020, los principales científicos de NVIDIA desarrollaron un ventilador de código abierto para abordar la escasez resultante de la pandemia mundial de coronavirus.[70] El 14 de mayo de', '[0.02245221845805645, -0.0036536776460707188, 0.03799606114625931, 0.004145571496337652, 0.0037055998109281063, -0.0005892477929592133, 0.005585727281868458, 0.06081993505358696, 0.017358385026454926, 0.00433686375617981, -0.015073811635375023, 0.05098205804824829, -0.024944480508565903, -0.025775235146284103, -0.0192931666970253, 0.02828935906291008, -0.07349986582994461, -0.06239399313926697, 0.0031262582633644342, -0.01570780761539936, -0.0023597239051014185, 0.03410463407635689, 0.02481330931186676, -0.019282236695289612, 0.03163423761725426, 0.015401740558445454, -0.008657330647110939, -0.012439447455108166, 0.04206238314509392, 0.00979961734265089, -0.021993117406964302, -0.020965605974197388, 0.044816989451646805, -0.029841557145118713, -0.010690491646528244, -0.07100760191679001, -0.010603044182062149, -0.04818372800946236, 0.0013602229300886393, 0.008996190503239632, 0.019610166549682617, 0.015893634408712387, -0.03779930621385574, 0.044226717203855515, -0.02001461200416088, -0.018604516983032227, -0.050544820725917816, -0.05968311429023743, 0.009755893610417843, 0.06392432749271393, -0.03023507073521614, 0.006640566047281027, 0.008345797657966614, 0.0933942347