(24, '2020, NVIDIA anunció oficialmente su microarquitectura de GPU Ampere y el acelerador de GPU NVIDIA A100.[71] [72] En julio de 2020, se informó que NVIDIA estaba en conversaciones con SoftBank para comprar Arm, un diseñador de chips con sede en el Reino Unido, por $32 mil millones. El 1 de septiembre de 2020, NVIDIA anunció oficialmente la serie GeForce 30 basada en la nueva microarquitectura Ampere de la empresa. El 13 de septiembre de 2020, se anunció que NVIDIA compraría Arm a SoftBank Group por $ 40 mil millones, sujeto al escrutinio habitual, y este último retendría una participación del 10% en NVIDIA.En octubre de 2020, NVIDIA anunció su plan para construir la computadora más poderosa en Cambridge, Inglaterra. Nombrada Cambridge-1, la computadora empleará IA para respaldar la', '[0.0037370561622083187, -0.037836022675037384, 0.04682421684265137, 0.016210852190852165, -0.007950272411108017, -0.03421934321522713, -0.028248613700270653, 0.04155970364809036, -0.018061991780996323, -0.020030835643410683, -0.004379069898277521, -0.004042012616991997, -0.037836022675037384, -0.07635685801506042, -0.0010225409641861916, -0.0008185677579604089, -0.0606917180120945, -0.022598890587687492, 0.014991025440394878, -0.05615482106804848, 0.012840278446674347, 0.05217433348298073, 0.03464735299348831, -0.018532803282141685, 0.042116113007068634, -0.0038253329694271088, -0.022770093753933907, -0.029789447784423828, 0.000852006021887064, -0.0465674102306366, -0.011395747773349285, -0.004186465870589018, -0.014295510947704315, 0.02919023483991623, -0.021400464698672295, -0.03338472545146942, -0.01396380364894867, -0.0011636503040790558, -0.027092987671494484, 0.041067492216825485, 0.014434613287448883, 0.02037324197590351, -0.02610856667160988, 0.061633337289094925, 0.006709045730531216, -0.02369031496345997, -0.04312193766236305, -0.04078928753733635, -0.04451296851038933, 0.07494442909955978, -0.050890304148197174, -0.008180327713489532, -0.02587316185235977, 0.06090572103