(25, 'investigación de atención médica, y se espera que finalice a fines de 2020, a un costo de aproximadamente £ 40 millones. Según Jensen Huang, \"La supercomputadora Cambridge-1 servirá como un centro de innovación para el Reino Unido y promoverá el trabajo innovador que realizan los investigadores de la nación en el descubrimiento de fármacos y atención médica crítica\". También en octubre de 2020, junto con el lanzamiento de NVIDIA RTX A6000, NVIDIA anunció que retirará su marca de GPU para estaciones de trabajo Quadro, cambiando el nombre del producto a NVIDIA RTX para futuros productos y la fabricación se basará en la arquitectura NVIDIA Ampere. En agosto de 2021, la adquisición propuesta de Arm Holdings se estancó después de que la Autoridad de Mercados y Competencia del Reino Unido', '[0.0007779583102092147, -0.026050912216305733, 0.06998822838068008, 0.0021753336768597364, -0.028764547780156136, -0.01757964678108692, -0.02543739415705204, 0.06390024721622467, -0.004961235914379358, -0.02763190120458603, 0.006353449542075396, -0.004701670259237289, -0.024493521079421043, -0.035513244569301605, 0.013733360916376114, 0.026003718376159668, -0.07060174643993378, -0.03638632968068123, -0.005326986778527498, 0.0022136785555630922, -0.03291759267449379, 0.031407393515110016, 0.05144111067056656, -0.05394237861037254, 0.010199734009802341, -0.013249626383185387, -0.0006046690396033227, -0.057481903582811356, -0.029496051371097565, -0.026050912216305733, 0.01649419218301773, -0.01658857986330986, -0.007816453464329243, 0.03272881731390953, -0.02425755187869072, -0.016564982011914253, -0.012341147288680077, 0.020753420889377594, -0.00926175992935896, 0.036504313349723816, 0.006524526514112949, 0.012435534968972206, -0.04068095237016678, 0.026923995465040207, -0.01833474449813366, -0.049458976835012436, -0.047736410051584244, -0.04523514211177826, -0.009067085571587086, 0.026853203773498535, -0.02160290814936161, 0.00011079454270657152, -0.046179018914699554, 0.062767