(26, 'planteara \"preocupaciones importantes sobre la competencia\".[78] En octubre de 2021, la Comisión Europea abrió una investigación de competencia sobre la adquisición. La Comisión declaró que la adquisición de NVIDIA podría restringir el acceso de los competidores a los productos de Arm y proporcionar a NVIDIA demasiada información interna sobre sus competidores debido a sus acuerdos con Arm. SoftBank (la empresa matriz de Arm) y NVIDIA anunciaron a principios de febrero de 2022 que \"habían acordado no seguir adelante con la transacción \'debido a importantes desafíos regulatorios\'\". Está previsto que la investigación finalice el 15 de marzo de 2022.[80] [81] Ese mismo mes, NVIDIA supuestamente se vio comprometida por un ciberataque. El ataque coincidió con la invasión rusa de Ucrania en', '[0.0238613523542881, -0.03115232288837433, 0.059470538049936295, 0.011462134309113026, -0.0033312186133116484, 0.002416990464553237, -0.008022351190447807, 0.041185975074768066, -0.016444677487015724, -0.0035969160962849855, 0.03090090863406658, -0.021861478686332703, -0.03295792266726494, -0.05467084050178528, -0.014296242035925388, 0.03412356227636337, -0.059196267277002335, -0.0353577695786953, -0.00633102934807539, -0.018718820065259933, 0.04082028567790985, 0.048408377915620804, 0.04735701531171799, -0.009153708815574646, 0.02392992004752159, -0.02626120112836361, -0.001628468744456768, -0.023038547486066818, 0.036157719790935516, -0.03533491492271423, 0.040111757814884186, -0.017198916524648666, -0.031860847026109695, -0.00028087515966035426, -0.0004503287491388619, -0.0004917547339573503, -0.04052316024899483, -0.006085330620408058, -0.022764278575778008, 0.028935318812727928, 0.01199924387037754, -0.0001766852947184816, -0.04945974051952362, 0.0402260348200798, -0.023838497698307037, -0.028798185288906097, -0.06029334291815758, -0.06024762988090515, -0.024455601349473, 0.020924394950270653, -0.027426842600107193, -0.021964330226182938, 0.017393188551068306, 0.056