(27, '2022, aunque no hay indicios de que el ataque proviniera de Rusia o de piratas informáticos rusos. En marzo de 2022, el director ejecutivo de NVIDIA, Jensen Huang, mencionó que están abiertos a que Intel fabrique sus chips en el futuro. Esta fue la primera vez que la empresa mencionó que trabajaría junto con los próximos servicios de fundición de Intel. En abril de 2022, se informó que NVIDIA planeaba abrir un nuevo centro de investigación en Ereván, Armenia. En septiembre de 2022, NVIDIA anunció su chip de grado automotriz de última generación, Drive Thor. Siguiendo las regulaciones del Departamento de Comercio de Estados Unidos que impusieron un embargo a las exportaciones a China de microchips avanzados, que entraron en vigencia en octubre de 2022, NVIDIA vio cómo se agregó su chip de', '[-0.010690469294786453, -0.022960705682635307, 0.020233985036611557, -0.019833633676171303, 0.020785821601748466, -0.03696218878030777, -0.012692227959632874, 0.03683234751224518, -0.04908094182610512, -0.028435783460736275, 0.01700953207910061, 0.048388440161943436, -0.02182457223534584, -0.03133562579751015, -0.04657062888145447, -0.0011341040953993797, -0.04912422224879265, -0.03497125208377838, 0.0018286328995600343, -0.03146547079086304, 0.015678634867072105, 0.04921078309416771, 0.021326838061213493, -0.017669571563601494, 0.021326838061213493, -0.016912149265408516, -0.010933926329016685, -0.006546289660036564, -0.010181915014982224, -0.019498204812407494, 0.021673087030649185, -0.01029552798718214, 0.0008311353158205748, -0.005407451651990414, 0.00045377688365988433, -0.012713868170976639, 0.022311486303806305, -0.02973422035574913, 0.00204233406111598, 0.039926957339048386, 0.014326094649732113, 0.010257656686007977, -0.05011969059705734, 0.07158719003200531, -0.0007161694811657071, -0.03315344080328941, -0.048518285155296326, -0.0502062551677227, -0.018394533544778824, 0.04449312761425972, -0.0314871110022068, -0.046181097626686096, -0.01491039153188467, 0.0971231