(32, 'contenido estático en una parte de la pantalla con la que no está interactuando. Sin embargo, esto es principalmente un beneficio para las PC AIO y las computadoras portátiles con limitaciones térmicas o de batería más estrictas. Como beneficio adicional, los dispositivos conectados a una PC o computadora portátil AIO deberían cargarse más rápido con esta función habilitada. Submuestreo de croma mejorado y compatibilidad con HDR Al pasar de DisplayPort 1.4a a DisplayPort 2.0, el ancho de banda se ha más que duplicado de 32,4 Gigabits por segundo a 80 Gigabits por segundo. Si bien esto obviamente beneficia a las pantallas de súper alta resolución (que analizaremos en la siguiente sección), también tiene una serie de beneficios para la reproducción del color y las implementaciones de HDR.', '[0.04003189876675606, 4.1451170545769855e-05, -0.013429904356598854, 0.041625674813985825, 0.019207341596484184, 0.0011118344264104962, 0.014871334657073021, -0.02442226931452751, 0.011976756155490875, -0.002815475221723318, 0.03032861463725567, 0.05943845957517624, -0.01716824620962143, 0.015246340073645115, -0.0020522791892290115, -0.013336152769625187, -0.026906685903668404, -0.02702387422323227, 0.017531532794237137, -0.007066520396620035, -0.015902601182460785, -0.021000340580940247, 0.02819576859474182, 0.04118035361170769, -0.005827242508530617, -0.005396571476012468, -0.02857077494263649, -0.02402382530272007, 0.02080111764371395, -0.03157082200050354, -0.002806686097756028, -0.04019596427679062, 0.007798954378813505, -0.0658135637640953, -0.0024624422658234835, 0.011361511424183846, -0.022008167579770088, 0.006861438974738121, -0.01494164764881134, -0.02910984493792057, 0.0182581078261137, 0.018914368003606796, -0.006580184679478407, 0.008771626278758049, 0.024750400334596634, -0.011865425854921341, -0.03904750570654869, -0.03614120930433273, 0.022066762670874596, 0.056719668209552765, -0.042235057801008224, 0.0007152215112000704, 0.005888767074793577, 0.06290727108