(33, 'Una de las mejoras más importantes se puede ver en Chroma Subsampling a altas resoluciones. Básicamente, las restricciones de ancho de banda en DP 1.2 y versiones anteriores de DisplayPort requerían formas menores de submuestreo cromático (4:2:2 y 4:2:0) cuando se ejecutaba a mayor resolución, especialmente con HDR habilitado. Chroma Subsampling es la práctica de reducir la información de color de alto ancho de banda a favor de la información de luminancia (básicamente la imagen sin color), reduciendo el ancho de banda requerido de una señal de video dada. En general, se considera una buena manera de manejar estas cosas y, de hecho, ya está bastante estandarizado en la televisión y el cine tal cual. Hay tres versiones básicas de submuestreo de crominancia: 4:4:4 : ancho de banda completo,', '[0.011377183720469475, 0.009714582934975624, 0.03141351044178009, 0.052794672548770905, 0.012858203612267971, -0.0026116452645510435, 0.04466892406344414, -0.0182034932076931, -0.045213665813207626, 0.023991387337446213, 0.026669707149267197, 0.05011635273694992, -0.032344114035367966, 0.013732061721384525, 0.04087841883301735, -0.017692796885967255, -0.00808035396039486, -0.014140618965029716, 0.022379856556653976, 0.013698015362024307, 0.0017491355538368225, -0.0011880786623805761, 0.00957272294908762, 0.035794150084257126, 0.009135792963206768, -0.03388755023479462, -0.02882598154246807, -0.027577612549066544, 0.006485845893621445, -0.020416511222720146, -0.00868184119462967, -0.03534019738435745, 0.0016313917003571987, -0.046620916575193405, -0.002692505484446883, -0.0038585958536714315, -0.05134202539920807, 0.0524769052863121, -0.020518651232123375, -0.013107877224683762, 0.06296321004629135, 0.02126767300069332, -0.009606769308447838, 0.026715101674199104, 0.030687186866998672, -0.037882331758737564, -0.05256769433617592, -0.03638428822159767, -0.027418728917837143, 0.031844764947891235, -0.02644273079931736, 0.02136981301009655, 0.017670098692178726, 0.041241582483