(49, 'lugar en este mundo, a pesar de sus inconvenientes y peculiaridades inherentes. Tarjetas gráficas integradas [iGPU] Las tarjetas gráficas integradas han recorrido un largo camino desde su creación. Ya no se usan solo para enviar una señal de video a su monitor, sino que también pueden ser útiles para un poco de juego ligero. Todavía no son particularmente buenos para la creación de contenido, pero pueden , en ciertos escenarios, aumentar su flujo de trabajo (por decir lo menos). Si no es un usuario particularmente exigente, entonces estas iGPU pequeñas, pero sorprendentemente potentes, no solo brindarán un rendimiento respetable (especialmente las RDNA 2 de AMD), sino que también servirán como una especie de respaldo en caso de que su tarjeta gráfica dedicada no funcione correctamente.', '[0.006394385825842619, 0.013151491060853004, 0.023787349462509155, -0.0006753448396921158, 0.026209376752376556, -0.06889322400093079, 0.03168526664376259, 0.038144003599882126, 0.007973968982696533, 0.004990312270820141, -0.012168639339506626, 0.04390070587396622, -0.02398626133799553, -0.0032556960359215736, -0.007166626397520304, 0.007739956956356764, -0.07118654251098633, -0.04961060732603073, 0.03196607902646065, 0.03924386203289032, 0.0225587859749794, 0.02744964323937893, 0.01626385562121868, 0.0034838581923395395, 0.03332335129380226, -0.022160964086651802, -0.013116389513015747, 0.015795830637216568, -0.008482946082949638, -0.0359208881855011, 0.02231307327747345, -0.013268496841192245, 0.022348174825310707, -0.06973566114902496, 0.005013713613152504, 0.03601449355483055, 0.002212878782302141, -0.004463784396648407, 0.03783978894352913, 0.015175697393715382, 0.021575933322310448, 0.0712333470582962, -0.02613917365670204, 0.013163192197680473, -0.021260017529129982, -0.00111448357347399, -0.022465180605649948, -0.04221582040190697, -0.03201288357377052, 0.02101430483162403, -0.06299611181020737, 0.01949322409927845, 0.006370984949171543, 0.0858825147151947, -0.0123558