(50, 'Tarjetas gráficas externas [eGPU] Las tarjetas gráficas externas (o eGPU, para abreviar) son una raza realmente fascinante. La configuración es bastante simple: compra una carcasa externa, la llena con la tarjeta gráfica de su elección y luego conecta todo a su computadora portátil, mini PC o placa base a través de un cable Thunderbolt. EGPU con portátil Thunderbolt 3 y 4 tienen 40 Gbps de ancho de banda que, aunque sin lugar a dudas es un número impresionante, aún presenta un cuello de botella. El rendimiento de una eGPU también depende en gran medida del resto de su compilación, pero, en la mayoría de los casos, puede esperar tener una pérdida de rendimiento de 15-25% en cuanto a gráficos. Sea como fuere, las eGPU han sido bastante populares tanto para los jugadores como para los', '[0.006665973924100399, -0.018350088968873024, 0.030430372804403305, 0.03208394721150398, 0.0019880218897014856, -0.00708510959520936, -0.014767343178391457, 0.034082017838954926, 0.02216249704360962, -0.026985425502061844, 0.012930037453770638, 0.07096592336893082, -0.015617096796631813, -0.049331653863191605, 0.006522434763610363, 0.03444947674870491, -0.04251065477728844, -0.07252763211727142, 0.021106047555804253, 0.055440694093704224, 0.011511866934597492, 0.03892790898680687, 0.04914792254567146, -0.01350419595837593, 0.017442919313907623, -0.009301358833909035, -0.005121489055454731, -0.02122087962925434, -0.003723414381965995, -0.028501201421022415, 0.04818333685398102, -0.009576954878866673, 0.025653379037976265, -0.07629410922527313, -0.014124286361038685, -0.0006839656853117049, -0.01275779027491808, 0.016845794394612312, 0.017247704789042473, 0.0075846267864108086, 0.05208761245012283, 0.025974906980991364, -0.010007573291659355, 0.03433464840054512, -0.000320631341310218, -0.0063272207044065, -0.006688940338790417, -0.03128012642264366, 0.00021046478650532663, 0.02581414207816124, -0.04675942659378052, 0.04643789678812027, -0.0016765412874519825, 0.10555320233106613, 