(56, 'Que hacemos? Abordar los mayores desafíos del mundo Nuestro trabajo en IA y el metaverso está transformando los sectores más grandes del mundo y afectando en profundidad a la sociedad. Reinventar los gráficos modernos NVIDIA RTX™ aprovecha la IA y el trazado de rayos para ofrecer un nuevo nivel de realismo en los gráficos. Potenciar el metaverso La siguiente etapa de Internet, el Internet 3D, promete un mundo en el que la colaboración virtual es fácil y los gigantes industriales pueden experimentar la eficiencia de los gemelos digitales. NVIDIA Omniverse™ es una herramienta para crear y operar aplicaciones de metaverso. Incluso estamos creando un gemelo digital de nuestro planeta, llamado Tierra-2, para ayudar a predecir el cambio climático con antelación. Aceleración de la ciencia Desde', '[0.02438007853925228, -0.009093700908124447, 0.06383398920297623, -0.010053048841655254, -0.004317066166549921, -0.02025545760989189, 0.013568743132054806, 0.05818130075931549, -0.04724358394742012, 0.015556374564766884, 0.0035817576572299004, 0.0037943078204989433, -0.04338321462273598, -0.09439525753259659, -0.026172393932938576, 0.01117898989468813, -0.06682118028402328, -0.0522528737783432, 0.028010666370391846, 0.0015409888001158834, -0.012707053683698177, 0.020967787131667137, 0.02805662341415882, -0.006623522844165564, 0.02536815032362938, -0.016176791861653328, -0.016797207295894623, 0.03430674597620964, 0.024609863758087158, -0.020818427205085754, -0.004681848455220461, -0.026586005464196205, -0.04099345952272415, 0.007226706016808748, 0.02527623623609543, -0.016130834817886353, -0.009317739866673946, -0.013821505941450596, -0.0014892873587086797, 0.021358419209718704, 0.030193613842129707, 0.049863122403621674, -0.015407015569508076, 0.015487439930438995, -0.02936639077961445, -0.02428816631436348, -0.04597977176308632, -0.03904029726982117, 0.034008026123046875, 0.03782244026660919, -0.027068551629781723, -0.021484801545739174, -0.020152054727077484, 0.0946709960