(58, 'autónomos La plataforma NVIDIA DRIVE® cubre todo, desde el coche hasta el centro de datos, incluida la vida útil como entornos simulados en los que los vehículos pueden aprender, adaptarse y evolucionar. Los fabricantes de automóviles, desde Mercedes Benz y Jaguar Land Rover, hasta Lucid Air y NIO, pasando por El Zoox de Amazon y GM\'s Cruise, aprovechan la potencia de DRIVE. Como un entorno de trabajo inigualable NVIDIA es una máquina de aprendizaje. La misión es el jefe. Todo el mundo tiene voz. Y hemos creado una cultura donde las personas pueden hacer el trabajo de su vida. NVIDIA fue pionera en la computación acelerada para afrontar desafíos que nadie más puede resolver. Nuestro trabajo en IA y gemelos digitales está transformando las industrias más grandes del mundo y tiene un impacto', '[0.020977165549993515, -0.009951463900506496, 0.011840235441923141, 0.005338730290532112, 0.03158969804644585, -0.05298003554344177, -0.014307442121207714, 0.07715630531311035, -0.038460105657577515, 0.016066361218690872, 0.025923386216163635, 0.011639553122222424, -0.02299579046666622, -0.07134833186864853, 0.009195955470204353, 0.03158969804644585, -0.04273344948887825, -0.01475602574646473, 0.014059541746973991, 0.02573450841009617, -0.0020909288432449102, 0.02419988252222538, 0.015027537010610104, -0.04825810715556145, 0.004887195769697428, -0.03343125060200691, -0.006522163283079863, 0.042450133711099625, -0.003830664325505495, -0.039687808603048325, 0.003420446766540408, -0.019407125189900398, -0.025946995243430138, 0.01715240441262722, 0.026112264022231102, 0.0022517694160342216, -0.010376437567174435, -0.01691630855202675, -0.02135492116212845, 0.04747898876667023, 0.01670382171869278, 0.009644538164138794, 0.009166442789137363, 0.03985307365655899, -0.022015990689396858, -0.032463256269693375, -0.04431529715657234, -0.025120658800005913, 0.01898215152323246, 0.05406607687473297, -0.07049839198589325, -0.0294176135212183, 0.003225667169317603, 0.08400310575962067